        const validWordCounts = [12, 15, 18, 21, 24];
        if (!validWordCounts.includes(words.length)) {
            return false;
        }
        // 检查每个单词是否只包含字母
        const wordRegex = /^[a-zA-Z]+$/;
        return words.every(word => wordRegex.test(word));
