            // 构建转账交易载荷
            const payload = {
                type: 'entry_function_payload',
                function: '0x1::coin::transfer',
                type_arguments: ['0x1::aptos_coin::AptosCoin'],
                arguments: [
                    params.to,
                    Math.floor(parseFloat(params.value) * Math.pow(10, 8)).toString()
                ]
            };
